import React, {Component} from 'react';
import Button from 'react-bootstrap/Button';

mining = () => {
  setTimeout(() => {
    this.setState({
      stock : this.state.stock + 1
    })
  }, 1000);
}

class Machine extends Component {

  mining = () => {
    setTimeout(() => {
      this.setState({
        stock : this.state.stock + 1
      })
    }, 1000);
  }

  render() {
    return (
      <div className="machine">
        <p>Machine</p>
      </div>
    )
  }
}
 export default Machine;
